def BattleSceneStart():
    global messenger, statusbar, wire, newsScrap2, index, Pause, playerX, playerY, news_PList
    
    def on_hit_wall(sprite3, location):
        sprite3.destroy()
    scene.on_hit_wall(SpriteKind.projectile, on_hit_wall)
    
    
    def on_on_overlap(sprite, mine):
        global hp
        if Pause:
            return
        hp = hp - 30
        if hp <= 0:
            game.over(False)
        statusbar.value = hp
        mine.destroy()
        music.big_crash.play()
        scene.camera_shake(4, 500)
    sprites.on_overlap(SpriteKind.player, MineSpriteKind, on_on_overlap)
    
    
    def on_on_overlap2(sprite2, bullet):
        global hp
        if Pause:
            return
        hp = hp - 20
        statusbar.value = hp
        if hp <= 0:
            game.over(False)
        bullet.destroy()
        music.pew_pew.play()
        scene.camera_shake(2, 200)
    sprites.on_overlap(SpriteKind.player, SpriteKind.projectile, on_on_overlap2)
    
    
    def on_on_overlap3(sprite32, newsScrap):
        global news_count, Pause, news_PList
        newsScrap.destroy()
        Pause = True
        news_PList[news_count].set_flag(SpriteFlag.INVISIBLE, False)
        sprite32.set_flag(SpriteFlag.INVISIBLE, True)
        news_PList[news_count].set_position(80,sprite32.y)
        game.show_long_text("Yes! I think I've found a piece!", DialogLayout.BOTTOM)
        pause(2000)
        Pause = False
        sprite32.set_flag(SpriteFlag.INVISIBLE, False)
        news_PList[news_count].set_flag(SpriteFlag.INVISIBLE, True)
        news_count = news_count + 1
        if news_count == 4:
            Pause = True
            change_Scene("PuzzleAnswer")
    sprites.on_overlap(SpriteKind.player, NewsSpriteKind, on_on_overlap3)

    def on_on_overlap2(sprite2, bullet):
        global hp
        if Pause:
            return
        hp = hp - 20
        statusbar.value = hp
        if hp <= 0:
            game.over(False)
        bullet.destroy()
        music.pew_pew.play()
        scene.camera_shake(2, 200)
    sprites.on_overlap(SpriteKind.player, SpriteKind.projectile, on_on_overlap2)

